import './App.css';
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import mainScreen from './components/mainScreen/mainScreen';

const App = () => {
  return (
    <div>
      <BrowserRouter>

        <Switch className='container'>
          <Route path='/'>
            <mainScreen />
          </Route>
        </Switch>
        <Redirect to={"/"} />
      </BrowserRouter>
    </div>
  );
}

export default App;
